import React from 'react';
import { useSelector } from 'react-redux';
import {
  Link,
} from 'react-router-dom';

import './FinishPage.css';
import { Button } from 'antd';
import { State } from '../reducers';

interface FinishProp {
  time?:number;
}

const FinishPage:React.FunctionComponent<FinishProp> = (props) => {
  const result = useSelector((state:State) => state.result);

  return (
    <div className="falcon-finish-main">
      <div className="row">
        <div className="col falcon-finish-col">
          <h5 className="falcon-finish-status">{result.status}</h5>
          {
                result.status === 'success' ? (
                  <div>
                    <h4 className="falcon-finish-congrats">Congratulations on finding falcone.King Shan is mightly pleased</h4>
                    {' '}
                    <h5 className="falcon-data">
                      PLANET FOUND:
                      {result.planet_name}
                    </h5>
                    <h5 className="falcon-data">
                      TIME TAKEN:
                      {props.time}
                    </h5>
                  </div>
                ) : (
                  <h6 className="falcon-finish-status">
                    So Sorry
                    {' '}
                    {result.error}
                  </h6>
                )
            }
          <Button type="primary"><Link to="/">START AGAIN</Link></Button>


        </div>
      </div>

    </div>
  );
};
export default FinishPage;
